% % run the clear-sky detection routine.
% csd = Batlles1990CSD(ghi,dif,exth,zen,1); %plot figure set to 1 so an output is plotted
%
function csd = Batlles1999CSD(ghi,dif,exth,zen,plot_figure)
% safety checks
if ~iscolumn(ghi)
    ghi = ghi';
    if ~iscolumn(ghi)
        error('var ghi must be a column vector')
    end
end
if ~iscolumn(dif)
    dif = dif';
    if ~iscolumn(dif)
        error('var dif must be a column vector')
    end
end
if ~iscolumn(zen)
    zen = zen';
    if ~iscolumn(zen)
        error('var zen must be a column vector')
    end
end
if ~iscolumn(exth)
    exth = exth';
    if ~iscolumn(exth)
        error('var exth must be a column vector')
    end
end
if length(unique([length(ghi),length(dif),length(zen),length(exth)]))~=1
    error('vars must be equal in length')
end

% clearness index
kt = ghi./exth;
% diffuse fraction
k = dif./ghi;

% criteria "high values of kt and low values of k corrrespond to cloudless
% conditions, while cloudy conditions present a combination of higher k and
% lower kt... the expressions defining the minimum kt, ktt, and the maximum
% k, kk allowed for cloudless conditions are":
h = 90 - zen;
ktt = -0.3262 - 0.0032.*h + 0.6842.*log10(h);
kk = 1.0827 - 0.3893.*log10(h);

% clear-sky detection time series. 0=clear, 1=cloudy.
csd = zeros(size(ghi));
csd((kt<ktt & k>kk))=1;

%% figure example
if exist('plot_figure','var')
    figure('name','Batlles CSD example','color','w');
    hold on
    plot(ghi)
    CSD = ghi;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off    
    legend('GHI','Clear detected')
    ylabel('Irradiance [Wm^{-2}]')  
    set(gca,'xtick',[]);
    xlabel('Time')
end
end